import React from 'react';
// import "../../Css/Project.css"
import Moment from 'moment';

const Experience = ({workexperience}) => (
            <div>
              <table>
                    <thead>
                        <tr>
                            <th>Company</th>
                            <th>Job</th>
                            <th>Location</th>
                            <th>From</th>
                            <th>To</th>
                        </tr> 
                    </thead>
                        {workexperience.map(exp =>(  
                            <tr key={exp._id}>
                                <td>{exp.company}</td>
                                <td>{exp.job}</td>
                                <td>{exp.location}</td>
                                <td> <Moment format="YYYY/MM/DD">{exp.from}</Moment></td>
                                <td>{exp.to}</td>

                            </tr>
                            ))}
                    
                        </table>
                    
                    
            </div>
);


export default Experience;
